import React from "react";
import UsersList from "../components/users-list/UsersList";

const Users = () => {
    const USERS = [{
        id: 'u1', name: 'Ash Yas', image: 'some-url', places: 3
    }];

    return (
        <UsersList itemes={USERS} />
    );
};

export default Users;
